import React, { Component } from 'react';
import NavigationBar from './NavigationBar';
import FooterFile from './FooterFile';
export default class IndexFile extends Component {
  render() {
    return (
      <React.Fragment>
          <NavigationBar />
          <FooterFile />
      </React.Fragment>
    );
  }
}
